INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('37807627', 'Risotto Funghi', 'N Gedroogd rijstgerecht met paddenstoelen Ingrediënten: parboiled rijst 80 %, Iactose, palmoliebereiding (palmolie, glucosestroop melkeiwit), paddenstoelenmix 3,5 % (Agaricus bisporus, Boletus edulis), gehydrolyseerd maiseiwit, aardappelzetmeel, natuurlijk aroma, zout, gistextract, uien, knoflook, peterselie, kurkuma. Kansporen van gluten, eieren, selderij, schaaldieren en weekdieren bevatten. Préparation déshydratée à base de riz et champignons Ingrédients: riz étuvé 80 %, lactose, préparation de l\'huile de palme (huile de palme, sirop de glucose, protéines de lait), mélange de champignons 3,5% (Agaricus bisporus, Boletus edulis), protéines de maïs hydrolysées, amidon de pomme de terre, arôme naturel, sel, extrait de levure, oighons, ail, persil, curcuma. Peut contentir des traces de gluten, d\'oeufs, de céleri, de crustacés et de mollusques. Getrocknetes Reisgericht mit Pilzen Zutaten: Parboiled Reis 80 96, Lactose, Palmölzubereitung (Palmöl, Glucosesirup, Milch - eiweiß), Pilzmischung 3,5 % (Agaricus Bisporus, Boletus edulis), hydrolysiertes Maiseiweiß, Kartoffelstärke, natürliches Aroma, Salz, Hefeextrakt, Zwiebeln, Knoblauch, Petersilie, Kurkuma. Kann Spuren von Gluten, Eiern, Sellerie, Krebstieren und Weichtieren enthalten.', 'https://static.openfoodfacts.org/images/products/37807627/front_de.3.400.jpg', '1.42', '0.579', '24.2', '1.42', '', '3', '1', '0.394', '', '1');

