VALUES ('3800205875109', 'Bruschette Tomato Olives and Oregano', '_pšenično_ brašno, biljno ulje (palmin olein, antioksidans: ekstrakt ruzmarina), ekstrudat krupnog kukuruznog brašna, praškasti dodatak sa ukusom paradajza, masline i origana 5.5% (dekstroza, kuhinjska so, skrob, paradajz u prahu 7.6%, crni luk u prahu, beli luk u prahu, pojačivač arome: mononatrijum-glutaminat; _hidrolizovani biljni protein_, suvi peršun, suvi origano 1.8%, ekstrat masline 1.8%, mlevena začinska paprika; kiselina: limunska kiselina, sirćetna kiselina; _laktoza_, maltodekstrin, sredstvo protiv zgrudnjavanja: silicijum-dioksid; arome), kuhinjska so, obrano _mleko_ u prahu, šećer, _gluten_ u prahu, kvasac, stabilizator: guar guma; dekstroza, emulgator: Mono - i diacetil estri vinske kiseline mono i diglicerida masnih kiselina.', 'https://static.openfoodfacts.org/images/products/380/020/587/5109/front_sr.21.400.jpg', '18', '7.3', '66', '5.5', '2.7', '9', '3', '1.18110236220472', '', '0');

